import React, { useState } from 'react';
import FacebookLogin from './FacebookLogin';
import GoogleLogin from './GoogleLogin';
import './css/LoginForm.css'; // Adjust the path to match your project structure

const LoginForm = () => {
  const [showSignup, setShowSignup] = useState(false);

  const toggleForm = () => {
    setShowSignup(!showSignup);
  };

  const handleLogin = () => {
    // Implement your login logic here
  };

  const handleSignup = () => {
    // Implement your signup logic here
  };

  return (
    <section className={`container forms${showSignup ? ' show-signup' : ''}`}>
      <div className="form login">
        <div className="form-content">
          <header>{showSignup ? 'Signup' : 'Login'}</header>
          <form>
            {/* Form fields for login */}
            {showSignup ? null : (
              <div className="field input-field">
                <input type="email" placeholder="Email" className="input" />
              </div>
            )}
            {showSignup ? null : (
              <div className="field input-field">
                <input type="password" placeholder="Password" className="password" />
                <i className='bx bx-hide eye-icon'></i>
              </div>)
            }
            <div className="form-link">
              <span>
                {showSignup
                  ? "Already have an account?"
                  : "Don't have an account?"}
                <button onClick={toggleForm} className="link signup-link">
                  {showSignup ? 'Login' : 'Signup'}
                </button>
              </span>
            </div>
            <div className="field button-field">
              <button onClick={showSignup ? handleSignup : handleLogin}>
                {showSignup ? 'Signup' : 'Login'}
              </button>
            </div>
          </form>
        </div>
        <div className="line"></div>
        <div>
          <FacebookLogin />
        </div>
        <div>
          <GoogleLogin />
        </div>
      </div>

      {showSignup && (
        <div className="form signup">
          <div className="form-content">
            <header>Signup</header>
            <form>
              {/* Form fields for signup */}
              <div className="field input-field">
                <input type="email" placeholder="Email" className="input" />
              </div>
              <div className="field input-field">
                <input type="password" placeholder="Create password" className="password" />
              </div>
              <div className="field input-field">
                <input type="password" placeholder="Confirm password" className="password" />
                <i className='bx bx-hide eye-icon'></i>
              </div>
              <div className="field button-field">
                <button onClick={handleSignup}>Signup</button>
              </div>
            </form>
            <div className="form-link">
              <span>
                Already have an account?{' '}
                <button onClick={toggleForm} className="link login-link">
                  Login
                </button>
              </span>
            </div>
          </div>
          <div className="line"></div>
          <div>
            <FacebookLogin />
          </div>
          <div>
            <GoogleLogin />
          </div>
        </div>
      )}
    </section>
  );
};

export default LoginForm;
